import React from 'react';
import banner from "../images/banner.jpg";

const Header = () => {
    return (
        <>
            <img 
                src={banner} 
                alt="Banner" 
                style={{ 
                    height: "820px", 
                    width: "100%", 
                    objectFit: "cover", 
                    overfl
                }} 
            /> 
        </>
    );
};

export default Header;
